import { useLocation } from "react-router-dom";
import "./Header.scss";

const Header: React.FC = () => {
  const location = useLocation();
  return (
    <div>
      <div className="header-container">
        {location.pathname === "/" && <p className="">Dashboard</p>}
      </div>
    </div>
  );
};

export default Header;
